import React, { useState, useEffect } from 'react';
import ContainerStyle from './containerStyles';

const Container = () => {
  const [stock, setStock] = useState([]);

  useEffect(() => {
    const getFriends = async () => {
      let r = await fetch('/data/products.json');
      let stock = await r.json();
      setStock(stock);
    };
    getFriends();
  }, []);

  return (
    <ContainerStyle>
      <div className="card">
        <div
          className="img"
          style={{ backgroundImage: "url('/images/182295.jpg')" }}
        >
          <span>1</span>
        </div>
        <div className="code">182295</div>
        <div className="name">ACME PRODUCT 02509</div>
        <div className="price">$22.99</div>
        <div className="chat"></div>
        <div className="stockout">
          <div className="percentage">
            <span className="count">25%</span>
            <span className="label">Stockout</span>
          </div>
          <div className="bar-wrap">
            <div className="bar"></div>
          </div>
        </div>
        <div className="coverage">
          <div className="title"></div>
          <div className="caption"></div>
        </div>
      </div>
    </ContainerStyle>
  );
};

export default Container;
